records.addlTxt:
Defendant Stacy L Hackett-Dodd in court with attorney Kelsey Morin.  Bryan C. Bayer appeared for the State of Wisconsin.  Parties orally amend the charges to a Misdemeanor (Possession of THC).  Defendant enters a guilty plea to the amended charges. Court finds the defendant guilty.  State to file the amended information.  

The Court Orders the Following:
CT#1:
Imposed and Stayed Sentence of:
120 Days Jail (Credit - 22 days if revoked) 

Term of Probation: 1 Years
Conditions of Probation:
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
No Use or Possession of prescription drugs without a valid prescription;
Any valid prescription drugs must be taken in the manner in which they are prescribed;
Get a high school diploma or its equivelent. 
Costs: $243.00 to be paid as a condition of probation.
